#!usr/env/bin python3
dna=""
cap_dna=dna.upper()
print(cap_dna)
rev_dna=cap_dna[::-1]
T_to_a=rev_dna.replace('T','a')
A_to_t=T_to_a.replace('A','t')
G_to_c=A_to_t.replace('G','c')
C_to_g=G_to_c.replace('C','g')
compl_dna=C_to_g.upper()
print(compl_dna)
reverse=dna[::-1]
a_to_i=reverse.replace('a','i')
t_to_k=a_to_i.replace('t','k')
g_to_p=t_to_k.replace('g','p')
c_to_f=g_to_p.replace('c','f')
A_to_I=c_to_f.replace('A','I')
T_to_K=A_to_I.replace('T','K')
G_to_P=T_to_K.replace('G','P')
C_to_F=G_to_P.replace('C','F')
i_to_t=C_to_F.replace('i','t')
k_to_a=i_to_t.replace('k','a')
p_to_c=k_to_a.replace('p','c')
f_to_g=p_to_c.replace('f','g')
I_to_T=f_to_g.replace('I','T')
K_to_A=I_to_T.replace('K','A')
P_to_C=K_to_A.replace('P','C')
F_to_G=P_to_C.replace('F','G')
print(F_to_G)

